  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0150629 includes physical
  and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1406
  in the North Pacific Ocean on 2014-10-22. These data include CURRENT SPEED - EAST/WEST
  COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
  to collect these data include ADCP and GPS. These data were collected by Philip
  Bresnahan of University of California - San Diego; Scripps Institution of Oceanography
  as part of Initial sea trials of the micro-rosette. The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling Deck to
  Repository (R2R) program.nnThe ADCP data represent the raw and automated processed
  data set. Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
